import axios from './Interceptor';

class AuthServices {
    login(user,data) { 
        return axios.post(`auth/login?user=${user}`,data)
    }
    forgot(data){  
        return axios.post("auth/verifybeforereset?user=${user}",data)
      }
      otpResend(data){ 
        return axios.post('/signup/otp-resend',data)
    }
}

export default new AuthServices();
